        public override int CalculateWinLine(int lineNumber)
        {
            var l = GetLine(lineNumber, UnicornGlobalData.GameLineShifted);
            for (var i = 0; i < 5; i++)
            {
                if (l.GetElement(i) > 6)
                {
                    l.SetElement(i, 7);
                }
            }
            return l.CalculateLineWin(WinForChristmasPresents, WinForWildChristmasPresent, 7, 1);
        }

        /// <summary>
        /// Daje pozicije dobitnih elemenata.
        /// </summary>
        /// <param name="lineNumber">Broj linije.</param>
        /// <param name="element">Simbol</param>
        /// <returns></returns>
        public byte[] GetLinesPositions(int lineNumber, int win, out int element)
        {
            var l = GetLine(lineNumber, UnicornGlobalData.GameLineShifted);
            for (var i = 0; i < 5; i++)
            {
                if (l.GetElement(i) > 6)
                {
                    l.SetElement(i, 7);
                }
            }
            element = l.GetWinningElement(7, win, WinForWildChristmasPresent);
            return l.GetLinesPositions(UnicornGlobalData.GameLineShifted, lineNumber, 7, element);
        }

        public bool GoldJackpotWin(out byte[] position)
        {
            var pos = new List<byte>();
            var cnt = 0;
            for (var i = 0; i < 5; i++)
            {
                for (var j = 1; j < 4; j++)
                {
                    if (GetElement(i, j) >= 17)
                    {
                        cnt++;
                        pos.Add((byte)(j * 5 + i));
                    }
                }
            }
            pos.Add(255);
            pos.Add(255);
            position = pos.ToArray();
            return cnt == 3;
        }

        /// <summary>
        /// Konstruiše matricu na osnovu dvodimenzionalnog niza za igru Christmas Presents.
        /// </summary>
        /// <param name="matrix"></param>
        public void FromMatrixArrayChristmasPresents(int[,] matrix)
        {
            for (var i = 0; i < 5; i++)
            {
                for (var j = 0; j < 5; j++)
                {
                    SetElement(i, j, matrix[i, j]);
                }
            }
        }

        public static int[,] GetMatixArray()
        {
            var reelsSet = -1;
            var specReelSet = -1;
            var sum = 0.0;
            var rnd = SoftwareRng.Next();
            var n = _ReelProbs.Length;
            var first = SoftwareRng.Next() < NO_OVERLAP_PROB;
            for (var i = 0; i < n; i++)
            {
                sum += _ReelProbs[i];
                if (rnd < sum)
                {
                    reelsSet = i;
                    break;
                }
            }
            if (first)
            {
                reelsSet = 0;
            }
            sum = 0.0;
            rnd = SoftwareRng.Next();
            n = _ReelProbsSpec.Length;
            for (var i = 0; i < n; i++)
            {
                sum += _ReelProbsSpec[i];
                if (rnd < sum)
                {
                    specReelSet = i;
                    break;
                }
            }
            var mat = new int[5, 5];
            var matSpec = new int[5, 5];
            var k = SoftwareRng.Next(_ReelsSpecial[specReelSet].Length);
            for (var i = 0; i < 5; i++)
            {
                var l = _Reels[reelsSet][i].Length;
                var p = SoftwareRng.Next(l);
                var lspec = _ReelsSpecial[specReelSet][k][i].Length;
                var pspec = SoftwareRng.Next(lspec);
                for (var j = 0; j < 5; j++)
                {
                    mat[i, j] = _Reels[reelsSet][i][(p + j) % l];
                    matSpec[i, j] = _ReelsSpecial[specReelSet][k][i][(pspec + j) % lspec];
                }
            }
            if (!first)
            {
                for (var i = 0; i < 5; i++)
                {
                    for (var j = 0; j < 5; j++)
                    {
                        mat[i, j] = Math.Max(mat[i, j], matSpec[i, j]);
                    }
                }
            }
            return mat;
        }

